import styled from "styled-components";
import Navbar from "../components/Navbar";
import { useContext, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { AuthContext } from "../context/AuthContext";

const Containter = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
`;

const ImageContainer = styled.div`
    border-radius: 50%;
    height: 100px;
    width: 100px; 
    overflow: hidden;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const ProfileImage = styled.img`
    object-fit: cover;
    width: 100%;
    height: 100%;
`;

const Head = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`;

const Header = styled.h3`
    font-family: "Poppins", sans-serif;
`;

const Email = styled.p`
    font-family: "Poppins", sans-serif;
`;

const PostImageContainer = styled.div`
    height: 100%;
    width: 15%; 
    overflow: hidden;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const PostImage = styled.img`
    object-fit: cover;
    width: 100%;
    height: 100%;
`;

const PostTitle = styled.span`
    font-family: "Poppins", sans-serif;
    font-size: 16px;
    padding-top: 8px;
`;

const PostAuthor = styled.span`
    font-family: "Poppins", sans-serif;
    font-size: 14px;
    padding-top: 8px;
`;

const Posts = styled.div`
    display: flex;
    align-items: center;
    width: 80%;
`;

const Post = styled.div`
    display: flex;
    width: 90%;
    background-color: #f2f2f2;
    border-radius: 15px;
    overflow: hidden;
    height: 10vh;
    &:hover{
        background-color: black;
        color: white;
        cursor: pointer;
    }
`;

const Section = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 80%;
`;

const PostData = styled.div`
    display: flex;
    flex-direction: column;
    padding-left: 10px;
    height: 100%;
`;

const Button = styled.button`
    margin-top: 5px;
    font-family: "DM Sans", serif;
    border: none;
    padding: 6px;
    background-color: black;
    font-size: 12px;
    color: white;
    border: 1px solid black;
    &:hover {
        cursor: pointer;
        background-color: white;
        color: black;
    }
`;

const Profile = () => {
    const {user} = useContext(AuthContext);
    const [profilePicture, setProfilePicture] = useState("");
    const changePicture = (e) => {
        setProfilePicture(e.target.files[0]);
        const reader = new FileReader();
        reader.onloadend = () => {
            document.getElementById("photoPreview").src = reader.result;
            console.log("selected photo");
        }
        if (profilePicture) {
            reader.readAsDataURL(profilePicture);
        }
    }
    return (
        <>
            <Navbar/>
            <Containter>
                <ImageContainer onClick={changePicture}>
                    <ProfileImage src={user.profilePicture}/>
                </ImageContainer>
                <Button>Change Profile Picture</Button>
                <Head>
                    <Header>{user.firstName + " " + user.lastName}</Header>
                    <Email>{user.email}</Email>
                </Head>
                <Posts>
                    <Section>
                        <Header>My Posts</Header>
                        <Post>
                            <PostImageContainer>
                                <PostImage src={require("../images/IMG_1547.jpeg")}/>
                            </PostImageContainer>
                            <PostData>
                                <PostTitle>My CULTR General Meeting Takeaways</PostTitle>
                                <PostAuthor>King Charles</PostAuthor>
                            </PostData>
                        </Post>
                    </Section>
                    <Section>
                        <Header>My Favorites</Header>
                        <Post>
                            <PostImageContainer>
                                <PostImage src={require("../images/P1010492.JPG")}/>
                            </PostImageContainer>
                            <PostData>
                                <PostTitle>Valentine's Day Photoshoot</PostTitle>
                                <PostAuthor>Alicia Keys</PostAuthor>
                            </PostData>
                        </Post>
                    </Section>
                </Posts>
            </Containter>
        </>
    )
}

export default Profile;
